class Player:
    def __init__(self, numbers):
        self.numbers = numbers
        self.turn = 0
        self.moves = []

    def play(self):
        while self.numbers:
            next_number = self.numbers.pop(0)
            if self.turn % 2 == 0:
                if self.moves[-1] in self.numbers:
                    self.numbers.remove(self.moves[-1])
            self.moves.append(next_number)
            self.turn += 1

        return len([move for move in self.moves if move % 2 != 0])

