class TrafficLightSolver:
    def __init__(self, T_g: int, T_y: int, T_r: int):
        self.T_g = T_g
        self.T_y = T_y
        self.T_r = T_r

    def get_probability(self, t_q: int, c_q: str) -> float:
        total_time = self.T_g + self.T_y + self.T_r
        for i in range(1, total_time + 1):
            if (t_q - i) % total_time < self.T_g:
                return 1 if c_q == "green" else 0
            elif (t_q - i) % total_time < self.T_g + self.T_y:
                return 1 if c_q == "yellow" else 0
            else:
                return 1 if c_q == "red" else 0
        return 0

